set nocount on

declare @nrItemNrs int = (select count (*) from ITEM_NOS);
print 'NR OF ITEM_NRS: ' + CAST( @nrItemNrs as VARCHAR(20) );
declare @nrSics int = (select count(*) from STOCK_INFO_CONFIG sic join ITEM_NOS i on sic.ITEM_NUMBER = i.Nr)
print 'NR OF SICs WITH MATCHING ITEM_NR: ' + CAST ( @nrSics as VARCHAR(20) );

declare @nmSics table (id int);
insert into @nmSics select STOCK_INFO_CONFIG_ID from STOCK_INFO_CONFIG sic join ITEM_NOS i on sic.ITEM_NUMBER = i.Nr
	where ( sic.ITEM_NUMBER != IsNull ( sic.INVENTORY_NUMBER, '' ) ) --or ( sic.INVENTORY_NUMBER is null )
--select * from @nmSics
--select * from STOCK_INFO_CONFIG sic join ITEM_NOS i on sic.ITEM_NUMBER = i.Nr where sic.ITEM_NUMBER != sic.INVENTORY_NUMBER
select * from STOCK_INFO_CONFIG sic join ITEM_NOS i on sic.ITEM_NUMBER = i.Nr where sic.STOCK_INFO_CONFIG_ID not in (select id from @nmSics);

declare @nrGoodSics int = (select count(*) from STOCK_INFO_CONFIG sic join ITEM_NOS i on sic.ITEM_NUMBER = i.Nr where sic.ITEM_NUMBER = sic.INVENTORY_NUMBER )
print 'NR OF SICs WITH MATCHING ITEM_NR THAT ALREADY HAVE INV NR = ITEM NR (THEY DO NOT NEED TO BE FIXED): ' + CAST ( @nrGoodSics as VARCHAR(20) );

print 'NR OF SICS THAT NEED FIXING: ' + CAST ( @nrSics-@nrGoodSics as VARCHAR (20) );

declare @nrBadSicsInInventory int = ( 
	select count(*) from STOCK_INFO_CONFIG sic
	join ITEM_NOS i on sic.ITEM_NUMBER = i.Nr
	where ( sic.ITEM_NUMBER != IsNull ( sic.INVENTORY_NUMBER, '' ) )
	and sic.STOCK_INFO_CONFIG_ID in (select si.STOCK_INFO_CONFIG_ID from STOCK s join STOCK_INFO si on s.STOCK_INFO_ID = si.STOCK_INFO_ID ) 
)
PRINT 'NR OF SICs THAT NEED FIXING THAT ARE IN INVENTORY: ' + CAST (@nrBadSicsInInventory as VARCHAR(20))


