-- create table that will hold all inventory SIC that will be updated
CREATE TABLE INV_SIC_UPDATED (STOCK_INFO_CONFIG_ID int primary key, OPERATIONAL_DATE datetime2(7), STOCK_INFO_ID int, QUANTITY decimal (38, 2));
declare @sInv table (sic_id int, op_date datetime2(7) )
insert into @sInv (sic_id, op_date)
select sic.STOCK_INFO_CONFIG_ID, max(s.OPERATIONAL_DATE)
	from STOCK_INFO_CONFIG sic
	join ITEM_NR_INV_NR ii on sic.ITEM_NUMBER = ii.ITEM_NUMBER
	join STOCK_INFO si on sic.STOCK_INFO_CONFIG_ID = si.STOCK_INFO_CONFIG_ID
	join STOCK s on si.STOCK_INFO_ID = s.STOCK_INFO_ID
	group by sic.STOCK_INFO_CONFIG_ID

insert into INV_SIC_UPDATED (STOCK_INFO_CONFIG_ID, OPERATIONAL_DATE, STOCK_INFO_ID)
select sInv.sic_id, sInv.op_date, MAX (si.STOCK_INFO_ID)
	from @sInv sInv join STOCK_INFO si on sInv.sic_id = si.STOCK_INFO_CONFIG_ID
	join STOCK s on si.STOCK_INFO_ID = s.STOCK_INFO_ID and s.OPERATIONAL_DATE = sInv.op_date
	group by sInv.sic_id, sInv.op_date

update INV_SIC_UPDATED set QUANTITY = siq.QUANTITY from INV_SIC_UPDATED isu join STOCK_INFO si on isu.STOCK_INFO_ID = si.STOCK_INFO_ID
	join STOCK_INFO_QUANTITY siq on si.BASE_QUANTITY_ID = siq.STOCK_INFO_QUANTITY_ID
	
-- here are SICs visible on inventory page that will be updated	
select * from INV_SIC_UPDATED where QUANTITY > 0	
	
-- update data
update sic set INVENTORY_NUMBER = ii.INVENTORY_NUMBER
from STOCK_INFO_CONFIG sic join ITEM_NR_INV_NR ii on sic.ITEM_NUMBER = ii.ITEM_NUMBER

